values:
I suck. I really do. I am coughing like a horny old sailor and sweating like a duck at christmas. S-U-C-K. I've been ill for ages now, and this&nbsp;is the first day I can actually look at the PC for a while.&nbsp;Plus, I am the best i have been&nbsp;in the week, but my mother says that if I am like this tommorrow, I can't go to see Kaisers because I lack pizzaz. PIZZAZ????!!!!! Just being in the same country as Kaisers will give me all the fucking PIZZAZ&nbsp;I need!!!!!!! Pizzaz my arse....

So, I&nbsp;have gotten back into CSI again and the Mighty Boosh.&nbsp;Not at the same time, obviously, coz that would be weird. It would be like 'So who killed Amanda? THE SHARK WITH KNEES!'&nbsp;Quite cool actually.&nbsp;

One of my friends pushed a letter through my door today telling me to get better. they also included a&nbsp;gift of cheese and chive sauce. SWEET!!

I have pizzaz? Dont I?

I&nbsp;have lost 4 pounds in as many days, and keeps on dropping.&nbsp;yuchy. wheres it all going, is what i want to know? I&nbsp;bet its just in snot alone.&nbsp;Maybe thats where I carry weight, in my nose. Now, all I have to do is sneeze of 2 stone and I will be as happy as a little pie.

Gareth wasn't amused by my Kaisers joke. He did that face like he's remembering my name so when he gets famous, he can slag me off to the NME. I later shouted that i&nbsp;was sorry, but&nbsp;Alice said he ran into the bathroom, with something shiny on his face. She thinks they were tears. Bet he was faking it...

Oh yeah, I am&nbsp;starting ricky and the giant pea up again. It...well, it made me smile and&nbsp;some of you seemed to enjoys some of it, so what the hell.&nbsp;Any slump&nbsp;in quality is&nbsp;totally my fault.

I found out my cat is epileptic.&nbsp;We&nbsp;were on my bed watching&nbsp;Enjoyment when&nbsp;some footage of&nbsp;one concert came up with flashing lights. She went really weird and fell on the floor, all shaking. She's ok now though, we&nbsp;got some medication. Its dead sad, she actually seemed to like Kaiser's DVD.&nbsp;


&nbsp;

OMG!

SNOW DAY! NO SCHOOL! We are going out for a walk in it now. Its beautiful! God, I can't remember the last time we had snow like this. Its proper snow too! You can sink into it and everything. Jess said that we might be the last generation to see snow thanks to global warming, so i am going to try and remember it all for my grandchildren.&nbsp;

OMG! Snow!

Ok so. No one here? Yeah, I know I was off line for AGES, but I feel so lonley. I am so sad. I should get myself some real friends (I don't count the ones from school coz they are virtual). I wrote a thingy-a-me-bob today, if I had anyone left I might have posted it.&nbsp;
My trumpet was having hot gay trumpet sex under my table in English. Mine and Jess' trumpets (Ricky and Terry) are in love. We are kinda hoping they adopt so we can have cornet babies and sell them on Ebay. We were mucking about and banging the table and making sex noises, (as you do) when Kate asked us to stop as the vibrations made her feel funny. Strange.&nbsp;
We are going to get our GCSE selection sheets soon! WAAA! I have a rough idea of what I want to do. I'm thinking of Law, Art, History, Long course RE (call me insane, but I like it) and triple sciences. I really hope that they are not in conflicting places. If I have to choose a language, I want to do German but we ain't got a German department. I have to do french or spanish.&nbsp;
If you were magic, what member of Franz Ferdinand would you be?
I'd be the one the other ones all secretly fancied. Bob.&nbsp;

I would be very hapsiful to hear from some of you. Tell me whats going on.

Gracy Pacy

We have started up doing the school magazine and I'm in charge of music, films and books!! WOooOO! Kate is helping me because, left to my own devices, I would just write about stuff not many people were interested in, so she's doing the more 'popular' side. Hope I can do posters. But maybe a full sized naked Ricky Wilson pull-out wouldn't be to everyone's tastes...
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;I had my first careers lesson today. We had to write down our ideas of jobs we wanted to do, then rated them out of 1. Strong Possibility 2. Possible 3. Unsure. I think I put down Psychologist, Lawyer, Sitcom Writer, Rock Star (I know, not much of a possiblity), forensic scientist and journalist. It was a good lesson. Alice had to explain why she wanted to be a Pathologist.
"Well, I want to be a pathologist because I want to see their brains and stuff."&nbsp;
Niice...
Isobel said she wanted to be Prime Minister or a Lawyer.&nbsp;
"I would like to be a lawyer as I really like knowing about other people's life."&nbsp;
Don't we just know it?&nbsp;
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I can't wait for Friday now. Its the only day I ever do anything interesting and gets me to meet new and exciting&nbsp;people. Orchestra is a god send.
Lots of Love
Grace P.M of the Gay Boy Science Club
P.S I seriously need new userpics. I will hunt for them...now!
